import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: grid;
  line-height: 2em;
  height: 400px;
  width: 100%;
  border: 1px solid black;
`;

const ImgContainer = styled.div`
  display: flex;
  margin: 0 auto;
`;

const Title = styled.h1`
  text-align: center;
  font-size: 1.7rem;
  color: #3696ff;
  background-color: white;
  width: 100%;
  margin: 0 auto;
  @media (max-width: 768px) {
    padding: 10px;
    width: 100%;
  }
`;

const Price = styled.p`
  font-size: 1.7rem;
  text-align: right;
  padding-top: 30px;
  background-colo: #3696ff;
`;

const item = props => {
  return (
    <div className="item">
      <Container>
        <ImgContainer><img src={props.url} /></ImgContainer>
        <Title>{props.name}</Title>
        <Price>{props.price}</Price>
      </Container>
    </div>
  );
};

export default item;
